  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Okefenokee NWR
  outlines Refuge accomplishments from January through April of 1943. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, big game animals, furbearers, predators,
  rodents, mammals, and fish- is also covered. The public relations section of the
  report describes recreational uses, Refuge visitors, Refuge participation, fishing,
  and violations. N-R forms and photographs are attached.\",\n\t\"license_title\":
